import styles from "./display.module.css";

export default function CompanyItem(props){
    return (
        <div key={props.data?.id} className={styles.companyItem}>
            <div className={styles.companyName}><span className={styles.textOverflow}>{props.data?.name}</span></div>
            <div className={styles.companyEmployees}>{props.data?.estimated_num_employees}</div>
            <div className={styles.companyLocation}>{props.data?.city}</div>
            <div className={styles.companyIndustry}>{props.data?.industry}</div>
            <div className={styles.companyKeywords}>{props.data?.keywords}</div>
        </div>
    )
}
